import "./header.css";
import React from "react";

const Header = () => {
  return (
    <div>
      <header>
            <div className="main">
          <ol>
            <li>Students</li>
            <li>Employers</li>
          </ol>
        </div>
<div></div>
        <ol>
          <li>
            <a href="#">Log In</a>
          </li>
          <li>
            <a href="#">Sign Up</a>
          </li>
        </ol>
      </header>
    </div>
  );
};

export default Header;
